const axios = require("axios").default;

export const authenticate = (user, pass) => {
  axios
    .post("http://test.elecsis.co/auth/", [{ user }, { pass }])
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });
};
